INSERT INTO `listings` (`listing_id`,`user_id`,`title`,`description`,`price`,`is_tradeable`,`is_biddable`,`starting_price`,`bid_increment`,`bid_start_time`,`bid_end_time`,`is_active`,`category`,`created_at`,`updated_at`) VALUES ('a066e3b3-521e-4865-b924-5257c3d8f66c','44444444-4444-4444-4444-444444444444','TNB 61 - Campus bicycle featuring lightweight frame, 7-speed drivetrain, disc brakes and bell and stand included, ideal for rarely taken outside campus','Listing TNB 61 overview: This sports listing is for a cycle set up with a lightweight frame and a 21-speed transmission that feels comfortable around campus. The braking setup uses dual disc brakes, giving reliable stopping power on typical hostel roads and academic-block slopes. In practice it has been rarely taken outside campus, so it has not seen aggressive off-road usage or stunt-style riding. Tyres, chain and basic running parts still hold up decently for daily short commutes between hostels, mess and departments. Accessories such as basic reflectors make it more practical for carrying small items or parking conveniently. The saddle height can be adjusted with basic tools, so it can be tuned to different rider heights across a normal student range. Visually, you will notice standard marks from lock usage, stands and normal parking, but there are no serious bends in the rim or frame. This is a good option for someone who wants a reliable cycle for everyday movement without going for a brand-new showroom piece.'627.00,1,0,NULL,NULL,NULL,NULL,1,'Sports','2025-09-25 19:57:54','2025-09-25 19:57:54');
